import React from 'react'

const PropertyForLiving = (props) => {
    return (
        <>
            <h1>Property for Living</h1>
            <p>Aliquam vel orci pulvinar, porta velit in, volutpat neque. Nam vel leo nec nibh tempus congue. Morbi rhoncus bibendum enim sit amet pulvinar. Quisque lobortis commodo nunc, a rhoncus diam aliquam ac.</p>
            <p>Contact us for more</p>
        </>
    )
}

export default PropertyForLiving
